  false,\n\t\"url\": null,\n\t\"notes\": \" A consolidated city is a unit of local
  government for which the functions of an incorporated place and its county or minor
  civiln               division (MCD) have merged. This action results in both the
  primary incorporated place and the county or MCD continuing to exist as legal entities,n
  \              even though the county or MCD performs few or no governmental functions
  and has few or no elected officials. Where this occurs, and where one or moren               other
  incorporated places in the county or MCD continue to function as separate governments,
  even though they have been included in the consolidatedn               government,
  the primary incorporated place is referred to as a consolidated city. The Census
  Bureau classifies the separately incorporated placesn               within the consolidated
  city as place entities and creates a separate place (balance) record for the portion
  of the consolidated city not within anyn               other place. The boundaries
  of the consolidated cities are those as of January 1, 2013, as reported through
  the Census Bureau's Boundary and Annexationn               Survey (BAS). \",\n\t\"license_title\":
